/* Professional boxing record */Tarver and Jones Jr. fought for the vacant WBA title as listed on the WBA official rankings. Boxrec is wrong.

Rankings before Tarver fight, WBA LHW (Unified) is vacant: https://www.wbaboxing.com/wp-content/uploads/rankings/2003-september.pdf

Rankings after Tarver fight with date of title won (11-08-03): https://www.wbaboxing.com/wp-content/uploads/rankings/2004-february.pdf
